import Link from 'next/link'

const linkStyle = {
    borderBottom: '1px solid white',
    textDecoration: 'none',
    width: '100%',
    textAlign: 'left'
  }

const Header = () => (
    <div>
        <Link href="/">
            <a style={linkStyle}>Home</a>
        </Link>
    </div>
)

export default Header;
